import React from 'react';
import { Link } from 'react-router-dom';
import Meditation from './components/sections/Meditation';
import LandingPage from './components/LandingPage'


function Sidebar() {

    return (
        <section className='sidebar'>
            <Link to='/'>Home<LandingPage noticeboard='home'/></Link>
            <p><Link to='/meditation'>명상<LandingPage noticeboard='meditation'/></Link></p>
            <Link to='/workout'>운동<LandingPage noticeboard='workout'/></Link>
        </section>
    )
}

export default Sidebar
